import "./W3.css";
import "./css/Buttons.css"
import "./css/Text.css"
import "./css/Image.scss"

function MenuImagePad(props) {
  const data = props.imagePadData;
  console.log(data);
  const classes = "w3-padding-64 " + props.className;
  return (
    <div className={classes}>
      <h1>{data.header}</h1>
      <div class="image-wrapper">
        <img class="image-1" src={data.image.default} alt={data.imageAlt} style={{ width: data.imgSize }}/>
        <img class="image-2" src={data.image.default} alt={data.imageAlt} style={{ width: data.imgSize }}/>
        <img class="image-3" src={data.image.default} alt={data.imageAlt} style={{ width: data.imgSize }}/>
        <img class="image-4" src={data.image.default} alt={data.imageAlt} style={{ width: data.imgSize }}/>
      </div>
      <div class="w3-center-align w3-padding-large">
      <button class="big-button">{data.buttonText}</button>
      </div>
      {props.children}
    </div>
  );
}
export default MenuImagePad;
